    employs a full time Executive Director, whose time is more than 25 percent devoted
    to federal elections and candidates.  No other entity pays compensation for their
    employees to work for the committee. The Fairfax County Democratic Committee maintains
    both Federal and Non Federal accounts, and continuing with this report, it identifies
    and accumulates qualified joint administrative expenses between accounts on a
    36 percent Federal, 64 percent Non Federal split, due to federal elections in
    Virginia this year for both President and Senate. The accumulation of August and
    September 2008 allocated expenses will result in a transfer from our Non Federal
    account to our Federal account in October 2008. The Committee does not engage
    in any fundraising on behalf of candidates for Federal office, so all of its reported
    fundraising expenses are party fundraising.The main purpose of this amendment
    is to align the corrected cumulative balance with the previously amended monthly
